import './Login.css';

class Login extends Component{

    state = {
        username: undefined,
        password: undefined
    };


    render(){

        return(
            <div>
                <form>
                    <div><input type ='text' placeholder='Enter username'/></div>
                    <div><input type ='text' placeholder='Enter password'/></div>
                    <div><input type ='button' value='Login'/></div>
                </form>
                <div>
                    Don't have account
                </div>
            </div>
        );
    }
};

export default Login;
